Mummy Detective

History Documentary hosted by Bob Brier, published by Discovery Channel in 2004 - English narration


Information
------------------------------

Life after death is an important element of many religions. Dead bodies were embalmed and mummified and, depending on the wealth of the deceased, equipped with both utility articles and precious ritual objects. When you think of a mummy what comes to mind? Most of us usually picture an Egyptian mummy wrapped in bandages and buried deep inside a pyramid. While the Egyptian ones are the most famous, mummies have been found in many places throughout the world. Mummies have a lot to tell us about the times and places in which they lived. Their bodies can tell us how long they lived, and the diseases and injuries they suffered from. In this series Dr. Bob Brier, whose work usually involves Egyptian archeology, follows an Italian team into the crypt of the Florentine family the Medicis and also investigates the biblical legend of the Three Wise Men.




3)  Murder of a Pharaoh 
In April 1167 B.C the unthinkable happenad. The Pharaoh was murdered in his harem. The murderers used black magic to silence the guards and a poisonous snake to finish him off. The plot was led by ladies of the harem but also had the backing of some thirty senior courtiers. They planned to put their own candidate on the throne of Egypt - but they were caught, tried and then put to death in a variety of horrible ways.



